【適合車種】トヨタ アルファード、ヴェルファイア（ANH25W）
店頭にてディスプレイ品として展示していた商品です。<br>車への取付けは行っておりません。<br>多少の汚れやキズがある場合はありますが、目立つものではありません。<br>付属品は画像の通りとなり、事前に確認を行っております。<br><table width="453"border="1.5" bgcolor="#000000" cellspacing="1" cellpadding="3"><tr><th colspan="2" align="center" bgcolor="#f0f0f0"><b><font color="#000000">商品説明</font></b></th></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">メーカー</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000">フジツボ</font></td></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">商品名</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000">オーソライズS 360-28125</font></td></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">対応車種</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000">ANH25W アルファード 240S 4WD<br>ボディ型式 ： DBA-ANH25W<br>エンジン型式 ： 2AZ-FE<br>年式 ： H20.05～H27.01<br><br>ANH25W ヴェルファイア 2.4Z 4WD<br>ボディ型式 ： DBA-ANH25W<br>エンジン型式 ： 2AZ-FE<br>年式 ： H20.05～H27.01</font></td></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">特記事項</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000">S・Zグレード（エアロバンパー標準装着車）専用</font></td></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">備考</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000"></font></td></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">出口形状</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000">110×90φ ラウンドオーバルスラッシュ</font></td></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">パイプ径</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000">60.5φ</font></td></tr><tr><th width="144" align="center" bgcolor="#f0f0f0"><font size="2" color="#000000">最低地上高</font></th><td width="294" bgcolor="#ffffff"><font size="2" color="#000000">ルーフ高1902mm（車検